import config from "../config";
import fs from "fs";
import path from "path";
import * as db from "../graphql/models/database";
import { ApolloServer, gql } from "apollo-server-express";
import { mergeType, mergeResolvers, makeExecutableSchema } from "graphql-tools";

export default (app) => {
  const Query = gql`
    type Query {
      status: String
    }
  `;

  const Mutation = `
   type Mutation {
     _empty: String
   }
  `;

  const statusResolvers = {
    Query: {
      status: () => "ok",
    },
  };

  const typeSchemaArray = [Query, Mutation];
  const resolverArray = [statusResolvers];

  fs.readdirSync(__dirname + "/schema")
    .filter((dir) => dir.indexOf(".") < 0)
    .forEach((dir) => {
      const tmp = require(path.join(__dirname + "/schema", dir)).default; // eslint-disable-line
      typeSchemaArray.push(tmp.types);
      resolverArray.push(tmp.resolvers);
    });

  const typeDefs = mergeType(typeSchemaArray);
  const resolvers = mergeResolvers(resolverArray);

  const schema = new ApolloServer({
    schema: makeExecutableSchema({ typeDefs, resolvers }),
    // context:({})
    playground: {
      endpoint: "/graphql",
      settings: {
        "editor.theme": "dark",
      },
    },
  });

  schema.applyMiddleware({ app });
};

